import React from "react";
import Container from "react-bootstrap/Container";
import Button from "react-bootstrap/cjs/Button";
import Link from "next/link";

const Index = ({ user }) => {
    console.log(user);
    return (
        <Container>
            <Link href="/users">
                <a>
                    <Button>
                        Show list of users
                    </Button>
                </a>
            </Link>
        </Container>
    );
}

export default Index;
